import React, { useEffect } from 'react'
import { useNavigate } from 'react-router-dom'
import Nav from "./Common/Nav";

function handleCancelEdit(indexToCancel) {
    document.getElementById(indexToCancel + "content").style.backgroundColor = "#6946c6";
    document.getElementById(indexToCancel + "contentButtons").style.backgroundColor = "#6946c6";
    handleExperienceClearInputs();
    setCancelExperienceInfoEditable({ display: false, indexToCancel: null });
    setExperienceEditable({ state: false, indexToEdit: null })
    setDateIsToPresent({ display: false, value: "" });
}


export default function Experience() {
    const handleLogout = () => {
        sessionStorage.removeItem('Auth Token');
        navigate('/login')
    }
    let navigate = useNavigate();
    useEffect(() => {
        let authToken = sessionStorage.getItem('Auth Token')
        console.log(authToken)
        if (authToken) {
            navigate('/experience')
        }

        if (!authToken) {
            navigate('/login')
        }
    }, [])
    return (
        <div>
            Experience Page
            <Nav />
            <button className='logoutbutton' onClick={handleLogout}>Log out</button>
        </div>
    )
}
